import React, { Component } from 'react'
import Info from './Info/Info'
import  './Body.css'


class Body extends Component{
    state={
        covidvalue:{
            "tested_positive":36456,
        "tested_negative":621654,
        "tested_total":658110,
        "in_isolation":16019,
        "quarantined":8939,
        "tested_rdt":312402,
        "pending_result":0,
        "recovered":20242,
        "deaths":195,
        "source":"https://drive.google.com/file/d/1O7aU9IpliQO8JbBCXS0b9DozgnUXvBVJ/view",
        "updated_at":"2020-08-28T00:00:00.000Z",
        "latest_sit_report":
        {"type":"MOHP",
        "_id":"5f3e7d96cbdb2c2f9b7f6e08",
        "no":192,
        "date":"2020-08-19",
        "url":"https://drive.google.com/file/d/1O7aU9IpliQO8JbBCXS0b9DozgnUXvBVJ/view",
        "created_at":"2020-08-20T13:41:42.590Z",
        "updated_at":"2020-08-20T13:41:42.590Z",
        "__v":0}
    }
    }
   
    render(){

       let inforender=""


        let printObj = (obj) =>{ 

            for(var prop in obj) { 
              inforender+=obj.map(data=>{
                  <Info type='info'></Info>
              })

            } 

        } 

        printObj(this.state.covidvalue)


       return(
        <div className="body">
            <div className="row">

                {inforender}

            </div>
        </div>
        )
    }
}

export default Body
